function w3tc_show_minify_help(){W3tc_Lightbox.open({id:"w3tc-overlay",close:"",width:800,height:610,url:ajaxurl+"?action=w3tc_ajax&_wpnonce="+w3tc_nonce+"&w3tc_action=minify_help",callback:function(b){jQuery(".btn-primary",b.container).click(function(){b.close()})}})}jQuery(function(b){b("#minify__enabled").click(function(){var a=b(this).is(":checked");if(!a){return}w3tc_show_minify_help()})});